import { PLAY_TONE } from "../actions/cord";
export default function cord(state = [], action) {
  switch (action.type) {
    case PLAY_TONE:
      return [
        ...state,
        {
          sound: action.sound
        }
      ];
    default:
      return state;
  }
}
